let taskDatabase = [];  
  
// 初始化：解析原始数据字符串为JS数组  
function initDatabase() {  
  try {  
    // 1. 移除注释和空行  
    let cleanData = rawDataSource  
      .replace(/--$\[\=*\[.*?$\=*\]\]/gs, '')  // 移除多行注释  
      .replace(/--.*$/gm, '')                     // 移除单行注释  
      .trim();  
      
    // 2. 移除 return { 和最后的 }  
    cleanData = cleanData  
      .replace(/^return\s*\{/, '')  // 移除开头的 return {  
      .replace(/\}\s*$/, '')        // 移除结尾的 }  
      .trim();  
      
    // 3. 处理特殊格式：移除类似 X="Comfy$" 这样的键值对  
    cleanData = cleanData.replace(/,?\s*[A-Za-z_][A-Za-z0-9_]*\s*=\s*"[^"]*"/g, '');  
      
    // 4. 分割成行，每行一个任务  
    const lines = cleanData.split('\n');  
      
    // 5. 解析每一行  
    taskDatabase = lines.map(line => {  
      line = line.trim();  
      if (!line) return null;  
        
      // 移除行尾的逗号  
      line = line.replace(/,$/, '');  
        
      // 移除大括号  
      line = line.replace(/^\{/, '').replace(/\}$/, '');  
        
      // 分割字段  
      const fields = [];  
      let currentField = '';  
      let inQuotes = false;  
      let escapeNext = false;  
        
      for (let i = 0; i < line.length; i++) {  
        const char = line[i];  
          
        if (escapeNext) {  
          currentField += char;  
          escapeNext = false;  
        } else if (char === '\\') {  
          escapeNext = true;  
        } else if (char === '"') {  
          inQuotes = !inQuotes;  
        } else if (char === ',' && !inQuotes) {  
          fields.push(currentField.trim().replace(/^"|"$/g, ''));  
          currentField = '';  
        } else {  
          currentField += char;  
        }  
      }  
        
      // 添加最后一个字段  
      if (currentField.trim()) {  
        fields.push(currentField.trim().replace(/^"|"$/g, ''));  
      }  
        
      // 确保至少有8个字段（根据新的数据结构）  
      while (fields.length < 10) {  
        fields.push('');  
      }  
        
      return fields;  
    }).filter(row => row !== null && row.length > 0);  
      
    console.log("数据库加载成功，条目数:", taskDatabase.length);  
      
    // 直接为文本框添加事件监听器，确保捕获所有滚动事件  
    setTimeout(function() {  
      const textareas = document.querySelectorAll('#inputData, #resultArea');  
      textareas.forEach(textarea => {  
        // 防止滚轮事件冒泡  
        textarea.addEventListener('wheel', function(e) {  
          e.stopPropagation();  
            
          // 检查是否滚动到底部或顶部  
          const isAtTop = this.scrollTop === 0;  
          const isAtBottom = this.scrollHeight - this.scrollTop <= this.clientHeight + 1;  
            
          // 如果滚动到底部且继续向下滚动，允许事件传递  
          if (isAtBottom && e.deltaY > 0) {  
            // 允许事件冒泡，让Swiper可以切换页面  
          }  
          // 如果滚动到顶部且继续向上滚动，允许事件传递  
          else if (isAtTop && e.deltaY < 0) {  
            // 允许事件冒泡，让Swiper可以切换页面  
          }  
          // 否则，阻止事件冒泡，只在文本框内滚动  
          else {  
            e.stopImmediatePropagation();  
          }  
        }, { passive: false });  
          
        // 防止触摸事件冒泡  
        textarea.addEventListener('touchmove', function(e) {  
          e.stopPropagation();  
        }, { passive: false });  
      });  
    }, 500);  
  } catch (e) {  
    console.error("数据解析失败:", e);  
    alert("原始数据格式有误，请检查控制台。");  
  }  
}  
  
// 查找任务 - 增强版，支持多种匹配方式  
function findTask(inputText) {  
  const input = inputText.trim();  
    
  // 尝试多种分隔符匹配  
  const separators = [' - ', ' – ', ' — ', '-', '–', '—'];  
    
  for (const separator of separators) {  
    const separatorIndex = input.indexOf(separator);  
      
    if (separatorIndex > 0) {  
      // 找到分隔符，分割为角色名和任务名  
      const charName = input.substring(0, separatorIndex).trim();  
      const taskName = input.substring(separatorIndex + separator.length).trim();  
        
      // 首先尝试完全匹配角色名和任务名  
      const exactMatch = taskDatabase.find(row => {  
        const rowCharName = row[0]?.trim();  
        const rowTaskName = row[4]?.trim();  
          
        return rowCharName.toLowerCase() === charName.toLowerCase() &&   
               rowTaskName.toLowerCase() === taskName.toLowerCase();  
      });  
        
      if (exactMatch) {  
        return {  
          data: exactMatch,  
          charName: charName,  
          taskName: taskName,  
          matchType: 'exact'  
        };  
      }  
        
      // 尝试模糊匹配任务名  
      const fuzzyMatch = taskDatabase.find(row => {  
        const rowTaskName = row[4]?.trim();  
        return rowTaskName.toLowerCase() === taskName.toLowerCase();  
      });  
        
      if (fuzzyMatch) {  
        return {  
          data: fuzzyMatch,  
          charName: charName,  
          taskName: taskName,  
          matchType: 'task_only'  
        };  
      }  
    }  
  }  
    
  // 如果没有找到分隔符或通过分隔符未找到匹配，尝试将整个输入作为任务名查找  
  const taskOnlyMatch = taskDatabase.find(row => {  
    const rowTaskName = row[4]?.trim();  
    return rowTaskName.toLowerCase() === input.toLowerCase();  
  });  
    
  if (taskOnlyMatch) {  
    return {  
      data: taskOnlyMatch,  
      charName: '',  
      taskName: input,  
      matchType: 'task_only_no_char'  
    };  
  }  
    
  // 最后尝试模糊匹配（包含关系）  
  const fuzzySearch = taskDatabase.find(row => {  
    const rowTaskName = row[4]?.trim();  
    const rowCharName = row[0]?.trim();  
      
    return rowTaskName.toLowerCase().includes(input.toLowerCase()) ||  
           rowCharName.toLowerCase().includes(input.toLowerCase());  
  });  
    
  if (fuzzySearch) {  
    return {  
      data: fuzzySearch,  
      charName: fuzzySearch[0]?.trim(),  
      taskName: fuzzySearch[4]?.trim(),  
      matchType: 'fuzzy'  
    };  
  }  
    
  return null;  
}  
  
// 主生成函数 - 修改以支持多种输入格式  
function translateTasks() {  
  const input = document.getElementById('inputData').value;  
  const lines = input.split('\n');  
  let output = [];  
  let foundCount = 0;  
  let notFoundCount = 0;  
  
  lines.forEach((line, lineIndex) => {  
    line = line.trim();  
    if (!line) return; // 跳过空行  
  
    // 使用增强的查找函数  
    const matchResult = findTask(line);  
  
    if (matchResult) {  
      foundCount++;  
      const data = matchResult.data;  
        
      // 数据提取 - 根据数据结构  
      const name = data[0];  
      const level = data[1];  
      const partner = data[2];  
      const partnerLevel = data[3];  
      const taskName = data[4];  
      const duration = data[5];  
      const building = data[6];  
      const happyTask = data[7];  
      const description = data[8];  
      const other = data[9];  
  
      // 构建头部: Atta5 或 Atta4+Heimlich4  
      let headerStr = `${name}${level}`;  
      if (partner && partner !== "") {  
        headerStr += `+${partner}${partnerLevel}`;  
      }  
  
      // 处理建筑  
      let buildingStr = building && building !== "" ? building : "No building";  
        
      // 处理笑脸任务  
      let happyTaskStr = "";  
      if (happyTask && happyTask !== "") {  
        if (happyTask === "Yes" || happyTask === "Alert") {  
          happyTaskStr = `, ${happyTask}`;  
        }  
      }  
  
      // 组合最终字符串  
      // 格式: Atta5 - Review a Report, 6h, No building, Alert (如果有描述会加上)  
      let resultLine = `${headerStr} - ${taskName}, ${duration}, ${buildingStr}${happyTaskStr}`;  
        
      // 如果有描述，添加到输出  
      if (description && description !== "" && description !== "Description Coming Soon...") {  
        resultLine += `, ${description}`;  
      }  
        
      // 添加匹配类型提示（调试用，正式版可以移除）  
      if (matchResult.matchType !== 'exact') {  
        resultLine += ` [匹配类型: ${matchResult.matchType}]`;  
      }  
        
      output.push(resultLine);  
  
    } else {  
      notFoundCount++;  
      output.push(`${line}  [未找到该任务数据]`);  
    }  
  });  
  
  // 添加统计信息  
  if (foundCount > 0 || notFoundCount > 0) {  
    const stats = `\n\n=== 统计 ===\n找到: ${foundCount} 个任务\n未找到: ${notFoundCount} 个任务`;  
    output.push(stats);  
  }  
  
  document.getElementById('resultArea').value = output.join('\n');  
}  
  
// 复制功能  
function copyResult() {  
  const resultArea = document.getElementById('resultArea');  
  resultArea.select();  
  resultArea.setSelectionRange(0, 99999); // 移动设备兼容  
    
  try {  
    const successful = document.execCommand('copy');  
    if (successful) {  
      alert("结果已复制到剪贴板");  
    }  
  } catch (err) {  
    console.error('复制失败:', err);  
    alert("复制失败，请手动复制文本");  
  }  
}  
  
// DOM加载完成后初始化翻译器数据  
if (document.readyState === 'loading') {  
  document.addEventListener('DOMContentLoaded', initDatabase);  
} else {  
  initDatabase();  
}  
  
// 导出函数供全局使用  
window.translateTasks = translateTasks;  
window.copyResult = copyResult;  
